import React from 'react'
import Person from './Person/Person'

const persons = (props=>{
    return props.persons.map((per)=>{
        <Person
            key = {per.id}
            name = {per.name}
            changeValue = {(event)=>{this.props.changeValue(event,per.id)}}
            deleteIt = {()=>{this.props.deleteIt(per.id)}}
        />
    })
})
export default persons
